Little Cats Puzzles

Adorable kitten puzzles. It contains a large selection of pictures with the SWEETEST kittens ever. 3 different levels in this beautiful and addictive puzzle game.

It is super simple to play. Play with friends, play with family or compete with anyone and see who can get the best score.
